  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:49.910838\",\n\t\"name\": \"parker-river-national-wildlife-refuge-public-use-management-big-game-hunting\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This hunt plan initiates the effort to
  manage Parker River National Wildlife Refugeu2019s white-tailed deer population
  at a level commensurate with the habitat. This action will provide a wildlife-dependent
  recreational opportunity for the hunting public to harvest surplus animals. As deer
  numbers are lowered, the potential threat to public and employee health and safety
  from Lyme disease will diminish. The hunt program has been deemed compatible with
  the purposes of the refuge, and will only have minimal impact on other existing
  uses. The implementation of a deer hunting program on portions of the refuge will
  increase the opportunities for the visiting public. Currently the refuge provides
  programs for bird watching, beach-use, hiking (trails), bicycling, guided tour groups,
  fishing, and outdoor education. An Environmental Assessment, Finding of No Significant
  Impact, Section 7 Evaluation Form, Compatibility Determination Form, and information
  about trends in deer population on the refuge are included.\",\n\t\"license_title\":
